import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { FaUtensils, FaUser, FaShoppingCart, FaSignOut } from 'react-icons/fa';
import './Dashboard.css';

const MemberDashboard = () => {
  const navigate = useNavigate();
  const [user, setUser] = useState(null);
  const [activeComponent, setActiveComponent] = useState(null);
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Get user data from localStorage
    const userData = localStorage.getItem('user');
    if (!userData) {
      navigate('/login');
      return;
    }

    const parsedUser = JSON.parse(userData);
    if (parsedUser.userType !== 'member') {
      navigate('/login');
      return;
    }

    setUser(parsedUser);
    fetchOrders(); // Fetch orders when component mounts
  }, [navigate]);

  const fetchOrders = async () => {
    try {
      setLoading(true);
      const token = localStorage.getItem('token');
      const response = await axios.get('http://localhost:5002/api/orders/my-orders', {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });
      setOrders(response.data);
    } catch (err) {
      setError('Failed to fetch orders');
      console.error('Error fetching orders:', err);
    } finally {
      setLoading(false);
    }
  };

  const handleLogout = () => {
    localStorage.removeItem('user');
    localStorage.removeItem('token');
    navigate('/login');
  };

  if (!user) return null;

  const renderOrders = () => (
    <div className="orders-section">
      <h2>My Orders</h2>
      {loading ? (
        <p>Loading orders...</p>
      ) : error ? (
        <p className="error-text">{error}</p>
      ) : orders.length === 0 ? (
        <p>No orders found</p>
      ) : (
        <div className="orders-list">
          {orders.map(order => (
            <div key={order._id} className="order-card">
              <h3>Order #{order._id.slice(-6)}</h3>
              <p>Date: {new Date(order.createdAt).toLocaleDateString()}</p>
              <p>Status: {order.status}</p>
              <p>Total: â‚¹{order.totalAmount}</p>
              <button 
                className="view-details-btn"
                onClick={() => navigate(`/orders/${order._id}`)}
              >
                View Details
              </button>
            </div>
          ))}
        </div>
      )}
    </div>
  );

  return (
    <div className="dashboard-container">
      <div className="dashboard-header">
        <h1>Welcome, {user.name}!</h1>
        <button className="logout-btn" onClick={handleLogout}>Logout</button>
      </div>

      <div className="dashboard-content">
        <div className="dashboard-card">
          <FaShoppingCart className="card-icon" />
          <h3>My Orders</h3>
          <p>View and track your tiffin orders</p>
          <button 
            className="dashboard-button"
            onClick={() => setActiveComponent('orders')}
          >
            View Orders
          </button>
        </div>

        <div className="dashboard-card">
          <FaUtensils className="card-icon" />
          <h3>Menu</h3>
          <p>Browse today's menu and place orders</p>
          <button 
            className="dashboard-button"
            onClick={() => navigate('/menu')}
          >
            View Menu
          </button>
        </div>

        <div className="dashboard-card">
          <FaUser className="card-icon" />
          <h3>Profile</h3>
          <p>Update your profile information</p>
          <button 
            className="dashboard-button"
            onClick={() => navigate('/profile')}
          >
            Edit Profile
          </button>
        </div>
      </div>

      {activeComponent === 'orders' && renderOrders()}
    </div>
  );
};

export default MemberDashboard;
